import React from "react";
import { Switch, Route } from "react-router-dom";
import Sidebar from "./Sidebar";
import Header from "./Header";
import Home from "./Home";
import AdminArtworks from "./AdminArtworks"; 
import './ArtistDashboard.css';

function AdminDashboard() {
  return (
    <div className="grid-container">
      <Header />
      <Sidebar />
      <div className="main-container">
        <Switch>
          <Route exact path="/admin-dashboard" component={Home} />
          <Route exact path={"admin-dashboard/artworks"} component={AdminArtworks} />

          {/* <Route path="/admin/artwork-status" component={ArtworkStatus} />  */}
          {/* Add other routes as needed */}
        </Switch>
      </div>
    </div>
  );
}

export default AdminDashboard;
